import React, { useState } from "react";
import Podaci from "./Podaci";
import Header from "./Header";

export default function Pocetna() {
  const [cartIco, setCartNum] = useState(0);
  const [cartItems, setCartItems] = useState([{}]);

  const gotivnaFunkcija = (e) => {
    if (cartItems.some((element) => element.id === e)) {
      console.log(e);
      let kopija = cartItems;
      kopija[e].kolicina += 1;
      setCartItems(kopija);
      console.log("id:", e, " kolicina: ", cartItems[e].kolicina);
    } else {
      console.log({ e });
      const obj = { id: e, naziv: "povlacim prop", kolicina: 1 };
      setCartItems([...cartItems, obj]);
      setCartNum(cartIco + 1);
    }
  };

  return (
    <>
      <Header cartIco={cartIco} />
      <Podaci gotivnaFunkcija={gotivnaFunkcija} />
    </>
  );
}
